<template>
    <div class="demo-container">
        <strong class="inference-address">
            推理服务地址: {{`/api/v1/inference/11/inference/user1-serving11`}}</strong>

        <div class="btn-container">
            <a-upload style="margin-right: 20px" accept="image/*" :show-upload-list="false" @change="onChange"
                      :beforeUpload="beforeUpload">
                <a-button>
                    上传本地图片
                </a-button>
            </a-upload>
            <a-button @click="newInference" :loading="isInferring"
                      :disabled="this.imagePixelRGBAData.length === 0">推理
            </a-button>
        </div>
        <strong class="image-examples-title">样例图片（点击图片以选择）</strong>
        <div style="width: 840px;margin-bottom: 20px;">
            <a-avatar class="image-item" shape="square" :size="100" v-for="(i, index) in images" :src="i" :key="index"
                      @click="selectImage"/>
        </div>

        <div style="display: flex;justify-content: center;width: 100%">
            <div class="image-show-box">
                <img :style="{width: `${resultWidth}px`, height: `${resultHeight}px`}" v-if="imageSrc" :src="imageSrc"
                     width="100%"/>
                <div v-else>未选中图片</div>
            </div>
            <div class="image-show-box">
                <canvas :style="{width: `${resultWidth}px`, height: `${resultHeight}px`}" ref="canvas"
                        :width="resultWidth" :height="resultHeight"></canvas>
            </div>
        </div>
    </div>
</template>

<script lang="ts">
    import {Component, Vue} from 'vue-property-decorator'
    import axios from 'axios'
    import baseUrl from '@/api/baseUrl'

    @Component
    export default class DemoEDSR extends Vue {
        private imageSrc: any = null
        private imagePixelRGBAData: any = []
        private isInferring: boolean = false
        private resultWidth: number = 0
        private resultHeight: number = 0
        private sizeLimit: number = 150
        private images: string[] = ['data:image/png;base64,', 'data:image/png;base64,']

        private selectImage(e: any): void {
            if (e.target.src) {
                this.imageSrc = e.target.src
                this.getImagePixelData(e.target.src).then((data) => {
                    this.imagePixelRGBAData = data
                    let canvas = this.$refs.canvas as HTMLCanvasElement
                    let context = canvas.getContext('2d')
                    if (context) {
                        context.clearRect(0, 0, canvas.width, canvas.height)
                    }
                }).catch((e: Error) => {
                    this.$message.warning(e.message, 5)
                })
            }
        }

        private getImagePixelData(imageSrc: string): Promise<number[]> {
            return new Promise<number[]>((resolve, reject) => {
                let content = document.createElement('canvas').getContext('2d')
                let image = new Image()
                image.src = imageSrc
                image.onload = (e: any) => {
                    if (content) {
                        if (image.width > this.sizeLimit || image.height > this.sizeLimit) {
                            reject(new Error(`请勿上传长宽超过${this.sizeLimit}像素的图片，当前图片大小${image.width}x${image.height}`))
                            return
                        }
                        this.resultWidth = 4 * image.width
                        this.resultHeight = 4 * image.height
                        content.drawImage(image, 0, 0, image.width, image.height)
                        let imagePixelData = content.getImageData(0, 0, image.width, image.height).data
                        let imagePixelRGBAData: any = []
                        let rowPixel: number[][] = []
                        for (let i = 0; i < imagePixelData.length; i += 4) {
                            rowPixel.push([imagePixelData[i], imagePixelData[i + 1], imagePixelData[i + 2]])
                            if ((i + 4) % (4 * image.width) === 0) {
                                imagePixelRGBAData.push(rowPixel)
                                rowPixel = []
                            }
                        }
                        resolve(imagePixelRGBAData)
                    }
                }
            })
        }

        private onChange({file}: any): void {
            const reader = new FileReader()
            reader.onload = (e: any) => {
                if (e.target.result) {
                    this.getImagePixelData(e.target.result).then((data) => {
                        this.imagePixelRGBAData = data
                        this.imageSrc = e.target.result
                        let canvas = this.$refs.canvas as HTMLCanvasElement
                        let context = canvas.getContext('2d')
                        if (context) {
                            context.clearRect(0, 0, canvas.width, canvas.height)
                        }
                    }).catch((e: Error) => {
                        this.$message.warning(e.message, 5)
                    })
                }
            }
            reader.readAsDataURL(file)
        }

        private newInference(): void {
            if (this.imagePixelRGBAData) {
                this.isInferring = true
                axios({
                    url: `${baseUrl.deepAI}/inference/11/inference/user1-serving11`,
                    method: 'post',
                    data: {
                        instances: [
                            {
                                input_1: this.imagePixelRGBAData
                            }
                        ]
                    }
                }).then((response) => {
                    let result = response.data.predictions[0]
                    let buffer = new Array(this.resultWidth * this.resultHeight * 4)
                    for (let y = 0; y < result.length; y++) {
                        let row = result[y]
                        for (let x = 0; x < row.length; x++) {
                            let pos = (y * row.length + x) * 4
                            buffer[pos] = result[y][x][0]
                            buffer[pos + 1] = result[y][x][1]
                            buffer[pos + 2] = result[y][x][2]
                            buffer[pos + 3] = 255
                        }
                    }

                    let canvas = this.$refs.canvas as HTMLCanvasElement
                    let context = canvas.getContext('2d')
                    if (context) {
                        var iData = new ImageData(new Uint8ClampedArray(buffer), this.resultWidth, this.resultHeight)
                        context.putImageData(iData, 0, 0)
                    }
                }).catch(() => {
                    this.$message.error('创建推理请求失败，请稍后再试')
                }).finally(() => {
                    setTimeout(() => {
                        this.isInferring = false
                    }, 400)
                })
            }
        }

        private beforeUpload(): boolean {
            return false
        }
    }
</script>

<style scoped>
    .demo-container {
        display: flex;
        flex-direction: column;
        align-items: center
    }

    .inference-address {
        font-size: 18px;
        margin-bottom: 20px
    }

    .image-show-box {
        margin-bottom: 10px;
        width: 600px;
        height: 600px;
        border: 1px dashed #000000;
        box-sizing: content-box;
        display: flex;
        justify-content: center;
        align-items: center
    }

    .image-show-box:nth-child(1) {
        margin-right: 20px;
    }

    .image-show-box:nth-child(2) {
        margin-left: 20px;
    }

    .btn-container {
        margin-bottom: 20px;
        display: flex;
        justify-content: center;
    }

    .image-examples-title {
        font-size: 20px;
    }

    .image-item {
        margin: 10px;
        cursor: pointer;
        transition: all 0.2s;
    }

    .image-item:hover {
        transform: scale(1.2);
    }
</style>
